  [],\n\t\"revision_timestamp\": \"2016-10-15T16:34:20.954751\",\n\t\"name\": \"annual-narrative-report-fy2005-2006-potomac-river-national-wildlife-refuge-complex\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Potomac
  River National Wildlife Refuge Complex outlines Refuge accomplishments during the
  2005 and 2006 fiscal years. The report begins with a summary of the year's highlights
  and weather conditions. The report includes a planning section which discusses research
  and investigations. Refuge administration is outlined; information about personnel,
  youth programs, volunteer programs, funding, safety, and technical assistance is
  given. Habitat management is also covered; subjects include wetlands, forests, grasslands,
  and fire management. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, game mammals,
  marking and bird banding, and disease control. The public uses of the Refuge described
  in this report include outdoor classrooms, interpretive programs, hunting, wildlife
  observation, outdoor recreation, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, major maintenance,
  equipment replacement, communication systems, computer systems, and energy conservation.
  Cooperative programs and items of interest are provided at the end.\",\n\t\"license_title\":
